import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { AuthContext } from '../../context/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const { login, loading, error, setError } = useContext(AuthContext);
  const navigate = useNavigate();

  const { email, password } = formData;

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onSubmit = async e => {
    e.preventDefault();
    setError('');

    try {
      console.log('Attempting to login with email:', email);
      // Use AuthContext login function
      await login(email, password);

      // On successful login, navigate to dashboard or home
      console.log('Login successful, redirecting to dashboard');
      navigate('/dashboard');

    } catch (err) {
      // Detailed error logging
      console.error('Login error:', err);

      if (err.response) {
        console.error('Server error response:', err.response.data);
        setError(err.response.data.message || 'Invalid login credentials');
      } else if (err.request) {
        console.error('No response received:', err.request);
        setError('Unable to reach server. Please check if the backend is running on port 5000.');
      } else {
        console.error('Error setting up request:', err.message);
        setError(`Login failed: ${err.message}`);
      }
    }
  };

  return (
    <div className="max-w-md mx-auto my-10 bg-white p-8 rounded-xl shadow-xl border border-gray-100">
      <div className="flex items-center justify-center mb-8">
        <div className="bg-green-50 p-3 rounded-full">
          <svg xmlns="http://www.w3.org/2000/svg" className="h-12 w-12 text-green-600" viewBox="0 0 20 20" fill="currentColor">
            <path fillRule="evenodd" d="M10 3.5a6.5 6.5 0 100 13 6.5 6.5 0 000-13zM2.5 10a7.5 7.5 0 1115 0 7.5 7.5 0 01-15 0z" clipRule="evenodd" />
            <path d="M10 6a.75.75 0 01.75.75v3.5a.75.75 0 01-1.5 0v-3.5A.75.75 0 0110 6z" />
            <path d="M10 14a1 1 0 100-2 1 1 0 000 2z" />
          </svg>
        </div>
      </div>

      <h1 className="text-2xl font-bold text-center text-gray-800 mb-2">Welcome Back!</h1>

      <div className="text-center text-gray-500 mb-8">
        Sign in to access your account and explore our premium Ayurvedic products
      </div>

      {error && (
        <div className="bg-red-100 text-red-700 p-3 rounded-lg mb-6">
          {error}
        </div>
      )}

      <form onSubmit={onSubmit}>
        <div className="mb-6">
          <label className="block text-gray-700 mb-2 font-medium" htmlFor="email">
            Email Address
          </label>
          <div className="relative">
            <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
                <path d="M2.003 5.884L10 9.882l7.997-3.998A2 2 0 0016 4H4a2 2 0 00-1.997 1.884z" />
                <path d="M18 8.118l-8 4-8-4V14a2 2 0 002 2h12a2 2 0 002-2V8.118z" />
              </svg>
            </div>
            <input
              type="email"
              id="email"
              name="email"
              value={email}
              onChange={onChange}
              className="w-full pl-10 px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
              placeholder="Enter your email"
              required
            />
          </div>
        </div>

        <div className="mb-6">
          <div className="flex justify-between items-center mb-2">
            <label className="block text-gray-700 font-medium" htmlFor="password">
              Password
            </label>
            <Link to="/forgot-password" className="text-sm text-green-700 hover:text-green-800">
              Forgot Password?
            </Link>
          </div>
          <div className="relative">
            <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M5 9V7a5 5 0 0110 0v2a2 2 0 012 2v5a2 2 0 01-2 2H5a2 2 0 01-2-2v-5a2 2 0 012-2zm8-2v2H7V7a3 3 0 016 0z" clipRule="evenodd" />
              </svg>
            </div>
            <input
              type="password"
              id="password"
              name="password"
              value={password}
              onChange={onChange}
              className="w-full pl-10 px-4 py-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
              placeholder="Enter your password"
              required
              minLength="6"
            />
          </div>
        </div>

        <div className="mt-6">
          <button
            type="submit"
            className="w-full bg-green-600 hover:bg-green-700 text-white py-3 px-4 rounded-lg transition duration-200 font-medium text-lg shadow-md hover:shadow-lg transform hover:-translate-y-0.5"
            disabled={loading}
          >
            {loading ? (
              <div className="flex items-center justify-center">
                <div className="animate-spin rounded-full h-5 w-5 border-t-2 border-white mr-2"></div>
                <span>Logging in...</span>
              </div>
            ) : 'Sign In'}
          </button>
        </div>
      </form>

      <div className="mt-8 border-t pt-6">
        <div className="flex items-center justify-center space-x-4">
          <hr className="w-full border-gray-200" />
          <span className="px-4 text-gray-500 text-sm font-medium">OR CONTINUE WITH</span>
          <hr className="w-full border-gray-200" />
